import React from "react"
import { useSelector } from "react-redux"

const Notification = () => {
  const style = {
    border: "solid",
    padding: 10,
    borderWidth: 1
  }

  const not = useSelector({ notification, blogs })

  return <div style={style}>{not}</div>
}

export default Notification
